import React, { useContext } from 'react';
import { AuthContext } from '../AuthContext';

const Dashboard = () => {
    const { user, logout } = useContext(AuthContext);

    return (
        <div className="p-6">
            <h2 className="text-2xl font-bold">Welcome, {user ? user.name : 'Guest'}</h2>
            <p>Email: {user ? user.email : 'N/A'}</p>
            {user?.image && <img src={user.image} alt="Profile" className="w-24 h-24 rounded-full mt-4" />}
            <button onClick={logout} className="mt-4 px-4 py-2 bg-red-500 text-white rounded">Logout</button>
        </div>
    );
};

export default Dashboard;
